--Crearem l'usuari naixement

CREATE USER naixement IDENTIFIED BY naixement
      DEFAULT TABLESPACE system
      TEMPORARY TABLESPACE temp
      QUOTA UNLIMITED ON users;
      
-- Assignem permisos i rols.

GRANT CREATE session TO naixement;
GRANT CREATE table TO naixement;
GRANT CREATE view TO naixement;
GRANT CREATE procedure TO naixement;
GRANT CREATE synonym TO naixement;
grant CONNECT, RESOURCE to naixement;
grant UNLIMITED TABLESPACE to naixement;

-- Inicialment s'esborren totes les taules
DROP TABLE sexe;
DROP TABLE tipus_part;
DROP TABLE tipus_atencio;
DROP TABLE Lloc_Part;
DROP TABLE regio;
DROP TABLE municipi;
DROP TABLE zona;
DROP TABLE estat_civil;
DROP TABLE nivell_estudi;
DROP TABLE relacio_professio;
DROP TABLE categoria_activitat;
DROP TABLE activitat;

-- Crear les taules

CREATE TABLE sexe (
 cod_sexe NUMBER (1) NOT NULL,
 desc_sexe VARCHAR2 (10),
 	CONSTRAINT pk_cs PRIMARY KEY (cod_sexe),
	CONSTRAINT desc_sexe CHECK (desc_sexe IN ('Home','Dona')));

 CREATE TABLE tipus_part (
 cod_part number (2) NOT NULL,
 desc_part varchar2 (10),
	constraint pk_cp primary key (cod_part),
	constraint desc_part check (desc_part in ('Simple','Doble','Triple','Desconegut')));

CREATE TABLE tipus_atencio (
 cod_atencio number (2) NOT NULL,
 desc_atencio varchar2 (40),
	constraint pk_ca primary key (cod_atencio),
	constraint desc_atencio check (desc_atencio in ('Metge','Llevadora','No atenció professional','Altre personal sanitari','Desconegut')));

CREATE TABLE lloc_part (
 cod_lloc_part number (2) NOT NULL,
 desc_lloc_part varchar2 (20),
	constraint pk_llc primary key (cod_lloc_part),
	constraint desc_llocp check (desc_lloc_part in ('Hospital','Domicili','Altre','Desconegut')));
	
CREATE TABLE regio (
 cod_regio number (2) NOT NULL,
 desc_regio varchar2 (20),
	constraint pk_cr primary key (cod_regio));

CREATE TABLE municipi (
 cod_mun number (3) NOT NULL,
 desc_municipi varchar2 (60),
 cod_regio number (2),
	constraint pk_cm primary key (cod_mun),
	constraint fk_cod_reg foreign key (cod_regio) references regio(cod_regio));	

CREATE TABLE hospital (
 cod_hosp number(4) not null,
 cod_mun number (3),
 cod_regio number (2),
 desc_hosp varchar2 (120),
	constraint pk_hosp primary key (cod_hosp),
	constraint fk_mun_hosp foreign key (cod_mun) references municipi(cod_mun),
    constraint fk_reg_hosp foreign key (cod_regio) references regio(cod_regio));

CREATE TABLE zona (
 cod_zona number (2) NOT NULL,
 desc_zona varchar2 (20),
	constraint pk_cz primary key (cod_zona),
	constraint desc_zona check (desc_zona in ('Urbà','Rural')));

CREATE TABLE estat_civil (
 cod_ec number (2) NOT NULL,
 desc_ec varchar2 (40),
	constraint pk_ec primary key (cod_ec),
	constraint desc_ec check (desc_ec in ('Casat', 'Solter', 'Parella', 'Vidu', 'Separat/Divorciat', 'Desconegut')));
	
CREATE TABLE nivell_estudi (
 cod_nivell number (2) NOT NULL,
 desc_nivell varchar2 (40),
	constraint pk_niv primary key (cod_nivell),
	constraint desc_niv check (desc_nivell in ('Superior', 'Mig', 'Secundari', 'Bàsic/Primari', 'Cap', 'Desconegut')));

CREATE TABLE activitat (
 cod_act number (2) NOT NULL,
 desc_activitat varchar2 (40),
	constraint pk_act primary key (cod_act),
	constraint desc_act check (desc_activitat in ('Inactiu', 'Actiu', 'Desempleat','Desconegut')));
	
CREATE TABLE relacio_professio(
 cod_relacio number (2) NOT NULL,
 desc_relacio varchar2 (150),
 cod_act number (2),
	constraint pk_prof primary key (cod_relacio),
	constraint fk_rel_act foreign key (cod_act) references activitat(cod_act));

CREATE TABLE categoria (
 cod_cat number (2) NOT NULL,
 desc_cat varchar2 (80),
 cod_act number (2),
	constraint pk_categ primary key (cod_cat),
	constraint fk_act_cat foreign key (cod_act) references activitat(cod_act));

CREATE TABLE nascut (
 cod_nascut number(6) not null,
 cod_sexe NUMBER (1), 
 data_naixament date,
 cod_part number (2),
 cod_atencio number (2),
 cod_lloc_part number (2),
 setmana number(2) not null,
 pes number (6) not null,
 mida number (6) not null,
 cod_zona  number (2),
 cod_mun number (3),
 cod_hosp number(4),
	constraint pk_nascut primary key (cod_nascut),
	constraint fk_sex_nasc foreign key (cod_sexe) references sexe(cod_sexe),
	constraint fk_part_nasc foreign key (cod_part) references tipus_part (cod_part),
	constraint fk_aten_nasc foreign key (cod_atencio) references tipus_atencio (cod_atencio),
	constraint fk_lloc_nasc foreign key (cod_lloc_part) references lloc_part (cod_lloc_part),
	constraint fk_zona_nasc foreign key (cod_zona) references zona (cod_zona),
	constraint fk_mun_nasc foreign key (cod_mun) references municipi (cod_mun),
	constraint fk_hosp_nasc foreign key (cod_hosp) references hospital (cod_hosp));

CREATE TABLE dades_mare (
	dni_mare varchar2 (10) not null,
	cod_nascut number(6),
	data_naix date,
	cod_ec number (2),
	cod_nivell number (2),
	cod_act number (2),
	cod_relacio number (2),
	cod_cat number (2),
	cod_zona number (2),
	fill_viu number (2),
	fill_mort number (2),
	fill_mortinat number (2),
	fill_total number (2),
	cod_mun number (3),
    cod_hosp number(4),
		constraint pk_mare primary key (dni_mare),
		constraint fk_nascut_mare foreign key (cod_nascut) references nascut(cod_nascut),
		constraint fk_ec_mare foreign key (cod_ec) references estat_civil(cod_ec),
		constraint fk_nivell_mare foreign key (cod_nivell) references nivell_estudi (cod_nivell),
		constraint fk_act_mare foreign key (cod_act) references activitat(cod_act),
		constraint fk_rel_mare foreign key (cod_relacio) references relacio_professio(cod_relacio),
		constraint fk_cat_mare foreign key (cod_cat) references categoria(cod_cat),
		constraint fk_zona_mare foreign key (cod_zona) references zona (cod_zona),
		constraint fk_mun_mare foreign key (cod_mun) references municipi (cod_mun),
		constraint fk_hosp_mare foreign key (cod_hosp) references hospital (cod_hosp));

CREATE TABLE dades_pare (
	dni_pare varchar2 (10) not null,
	cod_nascut number(6),
	data_naix_p date,
	cod_nivell number (2),
	cod_act number (2),
	cod_relacio number (2),
	cod_cat number (2),
		constraint pk_pare primary key (dni_pare),
		constraint fk_nascut_pare foreign key (cod_nascut) references nascut(cod_nascut),
		constraint fk_nivell_pare foreign key (cod_nivell) references nivell_estudi (cod_nivell),
		constraint fk_act_pare foreign key (cod_act) references activitat(cod_act),
		constraint fk_rel_pare foreign key (cod_relacio) references relacio_professio(cod_relacio),
		constraint fk_cat_pare foreign key (cod_cat) references categoria(cod_cat));

